import {gql} from 'apollo-boost'
import {graphql} from 'react-apollo';


const getEmpresas= 
gql`
{
  empresas{
    nombre,
    distrito,
    correo,
    canton,
    provincia
    }
  }
  `;


  const addEmpresa= 
gql`
mutation addEmpresa{ 
  addListing(
  nombre:String,
  distrito: String,
  correo: String,
  provincia:String,
  canton:String,
  ){
    nombre,distrito,correo,provincia,canton
  }
}
  `;


  const addEmpresas= 
gql`
mutation addEmpresa($nombre:String!,$distrito: String!,$correo: String!,$provincia:String!,$canton:String!)
{ 
  addListing(
  nombre:$nombre,
  distrito: $distrito,
  correo: $correo,
  provincia:$provincia,
  canton:$canton,
  ){
    nombre,distrito,correo,provincia,canton
  }
}
  `;

// module.exports =({
//   getEmpresas,
//   addEmpresa
// });
  export default ({getEmpresas,addEmpresas});
